  input: 'TEXT,F3XA,,"Response to letter dated February 18, 2005, period covered:
    07/01/03 - 12/31/03 - This response follows each bullet point.  The unitemized
    portion for $12,257.54 is received in the same file as the itemized receipts.  This
    files clearly states that these unitemized contributions are from the DNC, and
    are part of the joint fundraiser called the VIctory Fund.  We assessed the usual
    and normal charge for the goods and/or services provided to the federal political
    committees.  Market valuation was used for the information sold.  THe Democratic
    Party of SC did not have any employees who spent more than 25% of their time working
    with a Federal election during this reporting period.  The expenditure for insurance
    premiums is corrected in subsequent periods.  These payments do not represent
    a reimbursement to the non-federal account, but rather are actual payments for
    non FEA employees.  The individuals receiving such payments are not employees.  Each
    individual receives a 1099 for their services rendered.  All expenditures which
    refer to an event without a specific fundraising code are entirely for party operations
    and activities.  I have corrected the Joe Erwin entry.  The expenditures referenced
    are for the payment or reimbursement of expenses necessary for the admnistrative
    operations of the Party.  Fundraising expenditures are specified.  Ms. Wilbanks
    entry has been clarified.  The Party strives"'
